      </Switch> */}

      <Router>
        <Header />
        <Routes>
          <Route path='*' element={<NotFound />} />
          <Route path="/" exact element={<Home />} />
          <Route path="/calculator" exact element={<PricingCalculator />} />
        </Routes>
      </Router>
      {/* GOD IS GREAT!!! */}
    </div>
  );
}

export default App;
